import React from "react";

const socialLinks = [
  { icon: "facebook-official", url: "https://www.facebook.com/safarnama" },
  { icon: "instagram", url: "https://www.instagram.com/safarnama" },
  { icon: "snapchat", url: "https://www.snapchat.com" },
  { icon: "pinterest-p", url: "https://www.pinterest.com/himalyas" },
  { icon: "twitter", url: "https://www.twitter.com/safarnama" },
  { icon: "linkedin", url: "https://www.linkedin.com/in/nishant-sharma-b845881a7/" },
];

const Footer = () => (
  <footer className="w3-content w3-padding-64 w3-text-grey w3-xlarge">
    {socialLinks.map(({ icon, url }) => (
      <a
        key={icon}
        href={url}
        target="_blank"
        rel="noopener noreferrer"
        style={{ marginRight: "10px", color: "inherit", textDecoration: "none" }}
      >
        <i className={`fa fa-${icon} w3-hover-opacity`}></i>
      </a>
    ))}
  </footer>
);

export default Footer;






